import SalesChart from "./components/SalesChart";
import Custormerview from "./Custormerview";

export default function Dashboard() {
  return (
    <div className="container-fluid">
      <div className="row">
        
        <div className="col-md-2 p-0">
          <Sidebar />
        </div>

        <div className="col-md-10 p-4 bg-light">
          <Header />

          <div className="row g-3 mb-4">
            <StatsCard title="Today's Sales" value="â‚¹2,456"
              icon="fas fa-dollar-sign" gradient="card-blue" />
            <StatsCard title="Total Orders" value="156"
              icon="fas fa-shopping-bag" gradient="card-green" />
            <StatsCard title="New Customers" value="24"
              icon="fas fa-users" gradient="card-orange" />
            <StatsCard title="Pending Orders" value="12"
              icon="fas fa-clock" gradient="card-purple" />
          </div>

          <div className="row">
            <div className="col-md-8">
              <SalesChart />
            </div>
            <div className="col-md-4">
              {/* Quick stats / Low stock component */}
            </div>
          </div>


        </div>
      </div>
    </div>
  );
}
